----------------------------
-- SECTION 1: DROP TABLES --
----------------------------

-- Prompt Users whether to drop tables
ACCEPT dropTable CHAR PROMPT 'Do you want to drop the tables? (Y/N): '

-- PL/SQL 1
DECLARE
    type tablesarray IS VARRAY(14) OF VARCHAR(30);
    tables tablesarray;
    total integer;
    nCount integer;
    successCount integer;
    dropTable char;
BEGIN
    -- Assigning user input
    dropTable := '&dropTable';

    -- Assigning tables names to the array
    tables := tablesarray('diseases', 'victims', 'staffs', 'donors', 'shelters', 'items', 'tasks', 'disease_identifications', 'exam_allocations', 'workload', 'donations', 'donation_items', 'shelter_allocations', 'item_allocations');
    total := tables.count;
    successCount := 0;

    -- Enabling DBMS_OUTPUT package
    DBMS_OUTPUT.ENABLE;

    -- If User input 'Y' or 'y' then drop tables
    IF UPPER(dropTable) = 'Y' THEN
        -- Looping through the array
        FOR i in REVERSE 1 .. total LOOP -- Droping tables from the back
            SELECT COUNT(*) INTO nCount FROM user_tables WHERE LOWER(table_name) LIKE (tables(i)); -- Put the count of table into nCount

            IF (nCount > 0) THEN -- If nCount > 0 then table exist
                EXECUTE IMMEDIATE 'DROP TABLE ' || tables(i); -- Drop the table
                DBMS_OUTPUT.PUT_LINE('[SUCCESS] (' || tables(i) || ') is dropped.');
                successCount := successCount + 1;
            END IF;
        END LOOP;

        EXECUTE IMMEDIATE 'DROP SEQUENCE disease_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE victim_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE staff_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE donor_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE shelter_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE item_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE task_id_seq';
        EXECUTE IMMEDIATE 'DROP SEQUENCE donation_id_seq';
    END IF;

    -- Printing the summary
    DBMS_OUTPUT.PUT_LINE(chr(13));
    DBMS_OUTPUT.PUT_LINE(successCount || '/' || total || ' tables are successfully dropped. (' || round((successCount/total)*100, 2) || '%)');
    DBMS_OUTPUT.NEW_LINE();
END;
/

ACCEPT continue CHAR PROMPT 'Continue? (Y/N): '

-- PL/SQL 2
DECLARE
    continue char;
BEGIN
    -- Assign user input to variable
    continue := '&continue';
    
    IF UPPER(continue) = 'Y' THEN
        -- Show Users tables to be created
        DBMS_OUTPUT.PUT_LINE(chr(13));
        DBMS_OUTPUT.PUT_LINE('Below are the tables that will be created');
        DBMS_OUTPUT.PUT_LINE('------------------------------------------');
        DBMS_OUTPUT.PUT_LINE('1. diseases');
        DBMS_OUTPUT.PUT_LINE('2. victims');
        DBMS_OUTPUT.PUT_LINE('3. staffs');
        DBMS_OUTPUT.PUT_LINE('4. donors');
        DBMS_OUTPUT.PUT_LINE('5. shelters');
        DBMS_OUTPUT.PUT_LINE('6. items');
        DBMS_OUTPUT.PUT_LINE('7. tasks');
        DBMS_OUTPUT.PUT_LINE('8. disease_identifications');
        DBMS_OUTPUT.PUT_LINE('9. exam_allocations');
        DBMS_OUTPUT.PUT_LINE('10. workload');
        DBMS_OUTPUT.PUT_LINE('11. donations');
        DBMS_OUTPUT.PUT_LINE('12. donation_items');
        DBMS_OUTPUT.PUT_LINE('13. shelter_allocations');
        DBMS_OUTPUT.PUT_LINE('14. item_allocations');
    ELSE
        -- Exit if user doesn't input 'Y' or 'y'
        DBMS_OUTPUT.PUT_LINE('Okay, Good Bye!');
        RAISE_APPLICATION_ERROR(-20000, 'User Exited');
    END IF;
END;
/

