----------------
-- 2. victims --
----------------
CREATE TABLE victims (
    victim_id         NUMBER, -- PK
    name              VARCHAR(255)      NOT NULL,
    gender            CHAR(1)           NOT NULL,
    race              VARCHAR(12)       NOT NULL,
    ic_num            VARCHAR(15)       NOT NULL UNIQUE, -- IC Number must be specified and cannot be duplicated
    birth_date        DATE              NOT NULL,
    phone_num         VARCHAR(15)       NOT NULL,
    address           VARCHAR(255),
    weight            NUMBER(5,2),
    height            NUMBER(5,2),
    date_admitted     DATE              DEFAULT SYSDATE, -- Default to current date if not specified
    reason_admitted   VARCHAR(255),
    status            VARCHAR(10)       DEFAULT 'PENDING', -- Default to PENDING if not specified
PRIMARY KEY(victim_id),
CONSTRAINT chk_victim_gender CHECK (UPPER(gender) in ('M', 'F')),
CONSTRAINT chk_victim_race CHECK (UPPER(race) in ('CHINESE', 'MALAY', 'INDIAN', 'IBAN', 'KADAZANDUSUN', 'OTHERS')),
CONSTRAINT chk_victim_status CHECK (UPPER(status) in ('PENDING', 'RECOVERED', 'SERIOUS', 'DEATH'))
);

-- Following code is to auto-increment victim_id

-- This sequence is to auto increment the id.
CREATE SEQUENCE victim_id_seq START WITH 2001;

-- Below code is to trigger sequence to increment by 1 when CREATE or REPLACE is detected.
CREATE OR REPLACE TRIGGER victim_id_bir
BEFORE INSERT ON victims
FOR EACH ROW

BEGIN
    SELECT  victim_id_seq.NEXTVAL
    INTO    :new.victim_id
    FROM    dual;
END;
/
