-- 3. staffs --
---------------
CREATE TABLE staffs (
    staff_id          NUMBER, -- PK
    name              VARCHAR(255)      NOT NULL,
    gender            CHAR(1)           NOT NULL,
    race              VARCHAR(12)       NOT NULL,
    ic_num            VARCHAR(15)       NOT NULL UNIQUE, -- IC Number must be specified and cannot be duplicated
    birth_date        DATE              NOT NULL,
    phone_num         VARCHAR(15)       NOT NULL UNIQUE, -- Phone Number must be specified and cannot be duplicated
    email             VARCHAR(50)       NOT NULL UNIQUE, -- Email must be specified and cannot be duplicated
    address           VARCHAR(255)      NOT NULL,
    position          VARCHAR(30)       NOT NULL,
    kpi               NUMBER(3,2)       DEFAULT 2.00, -- Default to 2.00 if not specified
PRIMARY KEY(staff_id),
CONSTRAINT chk_staff_gender CHECK (UPPER(gender) in ('M', 'F')),
CONSTRAINT chk_staff_race CHECK (UPPER(race) in ('CHINESE', 'MALAY', 'INDIAN', 'IBAN', 'KADAZANDUSUN', 'OTHERS')),
CONSTRAINT chk_staff_email CHECK (REGEXP_LIKE(email,'^[a-zA-Z]\w+@(\S+)$'))
);

-- Following code is to auto-increment staff_id

-- This sequence is to auto increment the id.
CREATE SEQUENCE staff_id_seq START WITH 3001;

-- Below code is to trigger sequence to increment by 1 when CREATE or REPLACE is detected.
