--------------------------
-- 14. item_allocations --
--------------------------
CREATE TABLE item_allocations (
    item_id              NUMBER,     -- PK, FK1
    shelter_id           NUMBER,     -- PK, FK2
    date_allocated       DATE,       -- PK
    quantity_allocated   NUMBER,
PRIMARY KEY(item_id, shelter_id, date_allocated),
CONSTRAINT chk_item_allocations_items
           FOREIGN KEY (item_id)
