           FOREIGN KEY (shelter_id)
           REFERENCES shelters(shelter_id)
           ON DELETE CASCADE, -- If the shelter is deleted, this record is deleted as well
CONSTRAINT chk_is_quantityA_valid CHECK (quantity_allocated > 0)
);
