-- PL/SQL 4
DECLARE
    type tablesarray IS VARRAY(14) OF VARCHAR(30);
    tables tablesarray;
    nCount integer;
    totalRecord integer;
BEGIN
    -- Assigning tables names to the array
    tables := tablesarray('diseases', 'victims', 'staffs', 'donors', 'shelters', 'items', 'tasks', 'disease_identifications', 'exam_allocations', 'workload', 'donations', 'donation_items', 'shelter_allocations', 'item_allocations');
    totalRecord := 0;

    -- Enabling DBMS_OUTPUT package
    DBMS_OUTPUT.ENABLE;

    -- Looping through the array
    FOR i in 1 .. tables.count LOOP
        -- Select the row counts into nCount
        EXECUTE IMMEDIATE 'SELECT COUNT(*) FROM ' || tables(i) || '' INTO nCount;

        IF (nCount > 0) THEN
            DBMS_OUTPUT.PUT_LINE('[Success] ' || nCount || ' records are inserted into ' || tables(i) || '.');
            totalRecord := totalRecord + nCount;
        END IF;
    END LOOP;

    -- Printing the summary
    DBMS_OUTPUT.PUT_LINE(chr(13));
    DBMS_OUTPUT.PUT_LINE('A total of ' || totalRecord || ' records are successfully inserted.');
    DBMS_OUTPUT.NEW_LINE();
END;
/
